import * as React from "react";
import { Autocomplete, Stack, TextField, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useState } from "react";


export const CreateProduct = () => {
  const [value, setValue] = React.useState("");
  const [image, setImage] = useState();

  const handleImage = (e) => {
         console.log(e.target.files);
         setImage(URL.createObjectURL(e.target.files[0]));
     }

console.log(image)
  const handleChange = (event) => {
    setValue(event.target.value);
  };


  return (
    <>
      <Box
        sx={{
          width: 300,
        }}
      >
        <Typography variant="h6">choose a category</Typography>
        <Autocomplete
          freeSolo
          id="free-solo-2-demo"
          disableClearable
          options={tags.map((option) => option.title)}
          renderInput={(params) => (
            <TextField
              {...params}
              label="choose a category"
              InputProps={{
                ...params.InputProps,
                type: "search",
              }}
            />
          )}
        />
      </Box>
      <Box>
      <h2>Add Image:</h2>
            <input type="file" onChange={handleImage} />
            <img src={image} />
      </Box>
      <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <div>
        <TextField
          id="outlined-multiline-flexible"
          label="Multiline"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
        />
        <TextField
          id="outlined-textarea"
          label="Multiline Placeholder"
          placeholder="Placeholder"
          multiline
        />
        <TextField
          id="outlined-multiline-static"
          label="Multiline"
          multiline
          rows={4}
          defaultValue="Default Value"
        />
      </div>
      <div>
        <TextField
          id="filled-multiline-flexible"
          label="Multiline"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
          variant="filled"
        />
        <TextField
          id="filled-textarea"
          label="Multiline Placeholder"
          placeholder="Placeholder"
          multiline
          variant="filled"
        />
        <TextField
          id="filled-multiline-static"
          label="Multiline"
          multiline
          rows={4}
          defaultValue="Default Value"
          variant="filled"
        />
      </div>
      <div>
        <TextField
          id="standard-multiline-flexible"
          label="Multiline"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
          variant="standard"
        />
        <TextField
          id="standard-textarea"
          label="Multiline Placeholder"
          placeholder="Placeholder"
          multiline
          variant="standard"
        />
        <TextField
          id="standard-multiline-static"
          label="Multiline"
          multiline
          rows={4}
          defaultValue="Default Value"
          variant="standard"
        />
      </div>
    </Box>
    </>
  );
};

const tags = [
  { title: "Art" },
  { title: "Music" },
  { title: "Photography" },
  { title: "Collectibles" },
  { title: "Domain" },
];
